Android/Reward.html.body:
Reward 奖励广告
Vungle的奖励广告是全屏视频广告。在播放完毕广告后，会自动跳转到落地页。在落地页用户可点击跳转到商店下载广告应用或游戏。
请求广告
SDK发送广告请求，在服务器给填充后开始缓存视频广告素材。Placement Reference id传送门。
// Load Ad Implementation
if (Vungle.isInitialized()) {
    Vungle.loadAd("YOUR_REWARD_Placement_reference_id", new LoadAdCallback() {
        @Override
        public void onAdLoad(String placementReferenceId) { }

        @Override
        public void onError(String placementReferenceId, Throwable throwable) {
            // Load ad error occurred - throwable.getLocalizedMessage() contains error message
        }
    });
}
播放广告
if (Vungle.canPlayAd("YOUR_REWARD_Placement_reference_id")) {
    AdConfig adConfig = new AdConfig();
    // 静音播放
    // adConfig.setMuted(true); 
    // 自动控制广告方向
    // adConfig.setAutoRotate(true);

    // 开启Direct Download，该功能只存在特定版本6.3.23，请勿使用其他版本
    Map extras = new HashMap<>();
    extras.put("direct_download", true); 
    adConfig.setExtraSettings(extras);

    Vungle.playAd("YOUR_REWARD_Placement_reference_id", adConfig, new PlayAdCallback() {
        @Override
        public void onAdStart(String placementReferenceId) { }

        @Override
        public void onAdEnd(String placementReferenceId, boolean completed, boolean isCTAClicked) { }
            // 可以在此处开始请求下一条广告
        @Override
        public void onError(String placementReferenceId, Throwable throwable) {
            // Play ad error occurred - throwable.getLocalizedMessage() contains error message
        }
    });
}
注意
如果在Dashboard设置了auto cache则无需手动调用load方法来加载广告。
SDK会在初始化成功后，自动加载第一条广告。
SDK会在播放时，自动加载下一条。
自动缓存成功后，会在初始化中有回调onAutoCacheAdAvailable。

